// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;
import "@openzeppelin/contracts/access/Ownable.sol";

abstract contract AllowedTokenManager is Ownable {

    modifier isInvalidTokenAddr(address tokenAddress) {
        if (tokenAddress == address(0)) {
            revert ("Invalid token address");
        }
        _;
    }

    modifier isTokenExists(address tokenAddress, bool status) {
        if (allowedTokens[tokenAddress]._address != address(0) && status == true) {
            revert ("Token already exists");
        }
        else if (allowedTokens[tokenAddress]._address == address(0) && status == false) {
            revert ("Token is not exists");
        }
        _;
    }

    // [ALLOWED TOKENS]
    // Struct to hold token information
    // Mapping of token
    // Address to hold token addresses
    struct AllowedToken {
        address _address;
        string _name;
        string _symbol;
        bool _isActive;
        uint256 _totalDonationAmount;
    }
    mapping (address => AllowedToken) allowedTokens;
    address[] allowedTokenAdresses;

    /**
     * @dev Add a token to allowedTokens mapping and allowedTokenAdresses array
     * @param tokenAddress The address of the token
     * @param name The name of the token
     * @param symbol The symbol of the token
     */
    function addToken(address tokenAddress, string memory name, string memory symbol) external onlyOwner isInvalidTokenAddr(tokenAddress) isTokenExists(tokenAddress, true) {
        require(bytes(name).length > 0 && bytes(symbol).length > 0, "Missing receiver name or description");

        allowedTokens[tokenAddress] = AllowedToken(tokenAddress, name, symbol, true, 0);
        allowedTokenAdresses.push(tokenAddress);
    }

    /**
     * @dev Update a token's activity status from false to true or quite the opposite
     * @param tokenAddress The address of the token
     */
    function updateTokenActivity(address tokenAddress) external onlyOwner isInvalidTokenAddr(tokenAddress) isTokenExists(tokenAddress, false){  
        allowedTokens[tokenAddress]._isActive = !allowedTokens[tokenAddress]._isActive;
    }

    /**
     * @dev Remove a token from allowedTokens mapping and allowedTokenAdresses array
     * @param tokenAddress The address of the receiver
     */
    function removeToken(address tokenAddress) external onlyOwner isInvalidTokenAddr(tokenAddress) isTokenExists(tokenAddress, false){
        delete allowedTokens[tokenAddress];
        for (uint i = 0; i < allowedTokenAdresses.length; i++) {
            if (allowedTokenAdresses[i] == tokenAddress) {
                allowedTokenAdresses[i] = allowedTokenAdresses[allowedTokenAdresses.length - 1];
                allowedTokenAdresses.pop();
                break;
            }
        }
    }

    // [GETTERS]

    /**
     * @dev Gets only one receiver by address
     * @param tokenAddress The address of token 
     * @return allowdTokenData The information of token
     */
    function getTokenByAddress(address tokenAddress) external view returns (AllowedToken memory allowdTokenData) {
        return allowedTokens[tokenAddress];
    }

    /**
     * @dev Gets all receivers
     * @return allowdTokenData The information of receiver
     */
    function getAllTokens() external view returns (AllowedToken[] memory allowdTokenData) {
        allowdTokenData = new AllowedToken[](allowedTokenAdresses.length);

        for (uint i = 0; i < allowedTokenAdresses.length; i++) {
            allowdTokenData[i] = allowedTokens[allowedTokenAdresses[i]];
        }

        return allowdTokenData;
    }

    /**
     * @dev Gets all tokens with pagination
     * @param startIndex Which index to start searching
     * @param pageSize How much data per search
     * @return allowdTokenData The information of receiver
     */
    function getAllTokensPaginated(uint256 startIndex, uint256 pageSize) external view returns (AllowedToken[] memory allowdTokenData) {
        uint256 endIndex = startIndex + pageSize;
        if (endIndex > allowedTokenAdresses.length) {
            endIndex = allowedTokenAdresses.length;
        }
        uint256 resultSize = endIndex - startIndex;

        allowdTokenData = new AllowedToken[](resultSize);

        for (uint256 i = 0; i < resultSize; i++) {
            allowdTokenData[i] = allowedTokens[allowedTokenAdresses[startIndex + i]];
        }

        return allowdTokenData;
    }

}

